var empresa="INMOSOFT";
var fecha = new Date();
var hoy = fecha.getDate()+"/"+(fecha.getMonth()+1)+"/"+fecha.getFullYear();

/**
 *
 * @param {*} tabla tabla a utilizar
 * @param {*} titulo titulo a colocar en el documento a exportar
 * @param {*} columnas número de columnas en el datatable
 */
function cargarDataTable(tabla,titulo,col){

    var columnas=[];
    for(i=0;i<col;i++){
        columnas.push(i);
    }

    var orientacion = "portrait";

    if (col > 6) {
        orientacion = "landscape";
    }
    tabla.dataTable({
        "paging": true,
        "destroy":true,
        "lengthChange": true,
        "searching": true,
        "ordering": true,
        "info": true,
        "autoWidth": true,
        "language": idioma,
        "lengthMenu": [[5, 20, 50, -1], [5, 20, 50, "Mostrar Todo"]],
        dom: 'Bfrtip',
        buttons: {
            dom: {
                container: {
                    tag: 'div',
                    //className: 'flexcontent'
                },
                buttonLiner: {
                    tag: null
                }
            },
            buttons: [
                {
                    extend: 'pageLength',
                    titleAttr: 'Registros a mostrar',
                    className: 'selectTable'
                },
                {
                    extend: 'copyHtml5',
                    title: empresa,
                    text:'<i class="fa fa-files-o"></i>',
                    messageTop: titulo + "       Fecha: "+hoy,                           
                    exportOptions: {
                        columns:columnas
                    }
                },

                {
                    extend: 'pdfHtml5',
                    footer: true,                    
                    title: empresa,
                    text:'<i class="fa fa-file-pdf-o text-danger"></i>',
                    messageTop: titulo,
                    orientation: orientacion,
                    pageSize: 'LETTER',                  
                    exportOptions: {
                        columns: columnas
                    },
                    customize: function (doc) {
                        doc.content[1].margin = [5, 5, 5, 5],
                        doc.pageMargins = [20, 35, 20,30 ],

                        doc.styles.title = {
                            color: '#6C757D',
                            fontSize: '18',
                            alignment: 'center'
                        },
                        doc.styles.message = {
                            color: '#6C757D',
                            fontSize: '14',
                            alignment: 'center'
                        },

                        doc.styles['td:nth-child(2)'] = {
                            width: '100px',
                            'max-width': '150px'
                        },

                        doc.styles.tableHeader = {
                                fillColor: '#999999',
                                color: 'white',
                                alignment: 'center',
                        },
                        doc["header"] = function() {
                            return {
                                columns: [
                                    {
                                        image: 'data:image/png;base64,',
                                        width: 50,
                                        height: 50
                                    }
                                ],
                                margin: [40, 20,0,0]
                            }
                        },
                        doc['footer']=(function(page, pages) {
                            return {
                                columns: [
                                    {
                                        text: "Fecha: " + hoy,
                                        alignment: 'lef',
                                        color:'#6C757D',
                                    },
                                    {
                                        text: "Sistema InmoSoft",
                                        alignment: 'center',
                                        color:'#6C757D',
                                    },

                                    {
                                        alignment: 'right',
                                        color:'#6C757D',
                                        text: ['página ', { text: page.toString() },  ' de ', { text: pages.toString() }]
                                    }
                                ],
                                margin: [50, 0]
                            }
                        });


                    }
                },
                {
                    extend: 'excelHtml5',                   
                    title: empresa,
                    text: '<i class="fa fa-file-excel-o text-success"></i>',
                    messageTop: titulo + "       Fecha: "+hoy,                  
                    exportOptions: {
                        columns: columnas
                    },
                },
                {
                    extend: 'csvHtml5',                  
                    title: empresa,
                    text: '<i class="fa fa-file-text-o"></i>',
                    messageTop: titulo + "       Fecha: "+hoy,                   
                    exportOptions: {
                        columns: columnas
                    }
                },
                {
                    extend: 'print',                 
                    title: empresa,
                    text:'<i class="fa fa-print"></i>',
                    messageTop: titulo + "       Fecha: "+hoy,                  
                    exportOptions: {
                        columns: columnas
                    }
                },


            ]
        }
    });
}
